  backgoundColor: 'red',
  color: '#fff',
  fontWeight: 'bold',
  textAlign: 'center',
};

ReactDOM.render(
  <>
    <div className="myfirst">
      <img src={imgsrc} />
      <p style={newstyle}>This is my first projetc</p>
